import React, {useState} from "react";


function createCard(contact) {
    return (
        <Card
            id={contact.id}
            name={contact.name}
            tel={contact.tel}
            email={contact.email}
        />);
}
function emoji(emojipedia) {
    return (
        <Emoji
            id={emojipedia.id}
            Emoji={emojipedia.emoji}
            name={emojipedia.name}
            meaning={emojipedia.meaning}
        />
    )
}
